import logo from "./logo.png";
import Registro3 from "./componentes/zonaCliente/registroComponente/Registro3";
import Login from "./componentes/zonaCliente/loginComponente/Login";
import Tienda from "./componentes/zonaTienda/tiendaComponente/Tienda";
import { BrowserRouter, Route, Routes, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="container-fluid">
        <header className="bg-dark row col-12">
          <div className="text-white text-end col-11">contacto</div>
          <Link className="text-white col-1" path='/login'>login</Link>
        </header>
        <nav className="navbar navbar-expand-sm bg-light col-12 ">
          <ul className="navbar-nav col-12 d-flex flex-row justify-content-around">
            <li className="nav-item ">
              <img className="d-block" src={logo} alt="Logo de Agapea" ></img>
            </li>
            <li className="nav-item">
              <form className="d-flex">
                <input className="form-control me-1" type="search" placeholder="Buscar por libro, autor, ISBN..." aria-label="Search"/>
                <button className="btn btn-success" type="submit">Search</button>
              </form>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route exact path="/" component={Tienda} />
          <Route path="/registro" component={Registro3} />
          <Route path="/login" component={Login} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
